import styled from '@emotion/styled';


export const Input=styled.input`
    /* padding:0 2rem 0 2rem; */
    box-sizing: border-box;
    border: 3px solid #ccc;
    -webkit-transition: 0.5s;
    transition: 0.5s;
    outline:none;
    border: 1px solid red;
    &:focus{
        border: 3px solid #555;
    }
`
